import React from "react";
import styles from "./personSearch.module.scss";

const PersonSearch = ({
  personSearchTerm,
  handleSearch,
  searchResults,
  handlePersonClick,
}) => {
  return (
    <div>
      <div>
        <input
          type="text"
          placeholder="Search by name or personal code"
          value={personSearchTerm}
          onChange={handleSearch}
        />
        <div>
          {searchResults.map((person) => (
            <div className={styles.personWrapper} key={person.id}>
              <div className="">
                <p> {person.name}</p>
                <p>
                  Personal code: <span>{person.personal_code}</span>
                </p>
              </div>
              <div className={styles.imageBlock}>
                <img src="/assets/user.png" height={35} alt={person.name} />
                <button onClick={() => handlePersonClick(person)}>
                  Add person
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default PersonSearch;
